import  "./index.css"
import Home from "./Home.js";
import Contact from "./Contact.js";
import About from "./About.js";
import{BrowserRouter as Router,Routes,Route,Link} from "react-router-dom"
function App (){
    return(
        <div>
            <ul>
                <li> <Link></Link>
                    Home </li>
                <li>About</li>
                <li>Contact</li>
            </ul>
            <Routes>
                <Route path="/home" element={<Home/>}/>

            </Routes>
            <Router>
            </Router>
        </div>
    )
}
export default App;
